import React from 'react';
import { Nav, NavbarContainer, NavLogo }  from './NavbarElement';


const Navbar = () => {
    return (
        <>
            <Nav>
                <NavbarContainer>
                    <NavLogo to="/">Study Joa</NavLogo>
                    <MobileIcon>
                        <FaBrs/>
                    </MobileIcon>
                    <NavMenu>
                        <NavITem>
                            <NavLinks to="about">About</NavLinks>

                        </NavITem>
                    </NavMenu>
                </NavbarContainer>
            </Nav>
        </>
    );
};

export default Navbar;
